eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"sinopses\": () => /* binding */ sinopses,\n/* harmony export */   \"Sinopse\": () => /* binding */ Sinopse\n/* harmony export */ });\nfunction _classCallCheck(instance, Constructor) { if (!(instance instanceof Constructor)) { throw new TypeError(\"Cannot call a class as a function\"); } }\n\nvar Sinopse = function Sinopse(id, descricao, yt, imdb) {\n  _classCallCheck(this, Sinopse);\n\n  this.id = id;\n  this.descricao = descricao;\n  this.yt = yt;\n  this.imdb = imdb;\n};\n\nvar sinopses = [{\n  \"categoria\": \"Destaque\",\n  \"id\": \"geostormIntro\",\n  \"imagem\": \"./images/geostormCapa.jpg\",\n  \"descricao\": \"Em Tempestade: Planeta em Fúria, a ocorrência cada vez mais frequente de eventos climáticos capazes de ameaçar a existência da humanidade faz com que seja criada uma extensa rede de satélites ao redor de todo o planeta, de forma a controlar o próprio clima. Apelidado de 'Dutch Boy', este sistema construído a partir da cooperação de 17 países é coordenado pelo engenheiro Jake Lawson (Gerard Butler). Após anos de dedicação, ele é afastado da função devido a questões políticas e, em seu lugar, é nomeado seu irmão caçula, Max (Jim Sturgess). Três anos depois, quando a coordenação do 'Dutch Boy' está prestes a ser transferida dos Estados Unidos para a ONU, falhas pontuais provocam uma forte nevasca em pleno deserto no Afeganistão e altíssimas temperaturas em Hong Kong, que matam centenas de pessoas. Jake é então convocado para descobrir o que está acontecendo e, enviado para a estação internacional, desvenda uma imensa conspiração ao mesmo tempo em que precisa deixar para trás os atritos existentes com Max.\",\n  \"yt\": \"https://www.youtube.com/watch?v=EuOlYPSEzSc&ab_channel=WarnerBros.Pictures\",\n  \"imdb\": \"https://www.imdb.com/title/tt1981128/?ref_=nv_sr_srsg_0\"\n}, {\n  \"categoria\": \"Destaque\",\n  \"id\": \"greysAnat\",\n  \"imagem\": \"./images/greysCapa.jpg\",\n  \"descricao\": \"Grey’s Anatomy é um drama médico norte-americano exibido no horário nobre da rede ABC. Seu episódio-piloto foi transmitido pela primeira vez em 27 de março de 2005 nos Estados Unidos. O folhetim é protagonizado por Ellen Pompeo, como Dra. Meredith Grey, residente do fictício hospital cirúrgico Seattle Grace, emSeattle, Washington, o mais rígido programa cirúrgico de Harvard. A série é focada nela e seus colegas, também internos: Cristina, Izzie, George e Alex, mostrando suas vidas amorosas e as dificuldades pelas quais passam no trabalho. O título do seriado é uma brincadeira com Gray’s Anatomy (Anatomia de Gray), o famoso livro de anatomia de Henry Gray. A série, exibida nos Estados Unidos após o hit Desperate Housewives, logo se tornou um sucesso. Tal sucesso se repete no Brasil, onde a série é exibida pelo canal Sony Entertainment Television em horário nobre. Em Portugal, a série foi para o ar pelo canal Fox Life e pela RTP2.\",\n  \"yt\": \"https://www.youtube.com/watch?v=2wqzcLyaU8c&ab_channel=BAIXARDETUDOWEB\",\n  \"imdb\": \"https://www.imdb.com/title/tt0413573/?ref_=nv_sr_srsg_0\"\n}, {\n  \"categoria\": \"Destaque\",\n  \"id\": \"gambito\",\n  \"imagem\": \"./images/gambitoCapa.jpg\",\n  \"descricao\": \"O gambito da Rainha conta a história da Beth (Anya Taylor‑Joy), uma garota que se torna órfã muito cedo, e acaba indo pra um orfanato e passa a maior parte da sua infância com várias outras órfãs. Uma dessas órfãs é a Jolene (Moses Ingram), uma garota negra que tá a um bom tempo no orfanato, e já entende todas as coisas que acontecem lá. As duas se tornam instantaneamente boas amigas. Mas a amizade mais inesperada que a Beth faz no orfanato vem de baixo. Um dia qualquer ela desce até o porão do orfanato pra limpar apagadores e lá encontra, o zelador Shaibel (Bill Camp) que é um senhor amigável, que tá jogando Xadrez sozinho. Como a Beth é observadora, ele ensinar ela a jogar xadrez e os dois se aproximam, jogam juntos todos os dias, e com o passar do tempo a Beth se torna incrível no jogo e derrota o Shaibel facilmente. Então ele a introduz em times de xadrez e a paixão dela cresce mais e mais e nisso ela encontra um rumo em sua vida. Que é ser uma campeã de xadrez!\",\n  \"yt\": \"https://www.youtube.com/watch?v=cnqV3wsZlpo&ab_channel=NetflixBrasil\",\n  \"imdb\": \"https://www.imdb.com/title/tt10048342/?ref_=nv_sr_srsg_0\"\n}, {\n  \"categoria\": \"Destaque\",\n  \"id\": \"jurassic\",\n  \"imagem\": \"./images/jurassicCapa.jpg\",\n  \"descricao\": \"O novo filme traz um enredo diferente dos outros filmes da franquia, os quais eram voltados para os parques de entretenimento criados para a exibição dos não mais extintos dinossauros (que sempre acaba não dando certo). A cronologia de Jurassic World 2 se passa alguns anos depois do fechamento do parque Jurassic World do filme anterior, e logo é colocado em pauta o dilema ético que a sociedade está enfrentando, já que o vulcão existente na ilha que os dinossauros habitam não está adormecido como era dito, e sim mais acordado que nunca e sua erupção significará a morte de todos que estiverem na ilha. O dilema apresentado no filme é se o governo deve agir para salvar os dinossauros ou deixar que eles sejam extintos como um dia já foram. Claire (Bryce Dallas Howard) e Owen (Chris Pratt) estão de volta para a nova aventura e dispostos a salvar quantos dinossauros puderem com a ajuda do milionário Benjamin Lockwood (James Cromwell).\",\n  \"yt\": \"https://www.youtube.com/watch?v=vn9mMeWcgoM&ab_channel=UniversalPictures\",\n  \"imdb\": \"https://www.imdb.com/title/tt4881806/?ref_=nv_sr_srsg_0\"\n}, {\n  \"categoria\": \"Destaque\",\n  \"id\": \"crown\",\n  \"imagem\": \"./images/crownCapa.jpg\",\n  \"descricao\": \"Filha do rei George VI (Jared Harris), Elizabeth II (Claire Foy) sempre soube que não teria uma vida comum. Após a morte do seu pai em 1952, ela dá seus primeiros passos em direção ao trono inglês, a começar pelas audiências semanais com os primeiro-ministros. Ela assume a coroa com apenas 25 anos de idade, mas com grandes compromissos vêm grandes responsabilidades.\",\n  \"yt\": \"https://www.youtube.com/watch?v=4eMLckXA-UE&ab_channel=NetflixBrasil\",\n  \"imdb\": \"https://www.imdb.com/title/tt4786824/?ref_=fn_al_tt_1\"\n}, {\n  \"categoria\": \"Destaque\",\n  \"id\": \"hill\",\n  \"imagem\": \"./images/hillCapa.jpg\",\n  \"descricao\": \"Shirley (Elizabeth Reaser/Lulu Wilson), Theo (Kate Siegel/Mckenna Grace), Nell (Victoria Pedretti/Violet McGraw), Luke (Oliver Jackson-Cohen/Julian Hilliard) e Steven (Michiel Huisman/Paxton Singleton) são cinco irmãos que cresceram na mansão Hill, a casa mal-assombrada mais famosa dos Estados Unidos. Agora adultos, eles retornam ao antigo lar e são forçados a confrontar os fantasmas do passado, após o suicídio da irmã mais nova.\",\n  \"yt\": \"https://www.youtube.com/watch?v=TvELCT5LGQw&ab_channel=MundodosTrailers\",\n  \"imdb\": \"https://www.imdb.com/title/tt6763664/?ref_=nv_sr_srsg_3\"\n}, {\n  \"categoria\": \"Destaque\",\n  \"id\": \"lucifer\",\n  \"imagem\": \"./images/luciferCapa.jpg\",\n  \"descricao\": \"Lucifer Morningstar (Tom Ellis), o famigerado Senhor do Inferno, se cansa da vida demoníaca que leva no subterrâneo e abandona seu trono para tirar férias em Los Angeles. Lá, ele abre uma casa noturna chamada 'Lux' e passa a desfrutar de tudo o que mais gosta: vinho, mulheres e excessos. Sua nova rotina se complica quando uma estrela do pop é brutalmente assassinada diante de seus olhos. Pela primeira vez em mais de 10 milhões de anos, Lucifer sente despertar em seu interior um desejo de justiça e resolve punir os responsáveis pelo crime. Ele conhece, então, a policial Chloe Decker (Lauren German) e se junta a ela para desvendar o caso. Mas seus poderes de persuasão se mostram tão úteis que ele se torna uma espécie de consultor em outras investigações de homicídio, formando uma dupla improvável com Chloe.\",\n  \"yt\": \"https://www.youtube.com/watch?v=NcnK3C5W7SI&ab_channel=NetflixBrasil\",\n  \"imdb\": \"https://www.imdb.com/title/tt4052886/?ref_=nv_sr_srsg_0\"\n}, {\n  \"categoria\": \"Destaque\",\n  \"id\": \"peaky\",\n  \"imagem\": \"./images/peakyCapa.jpg\",\n  \"descricao\": \"Em Peaky Blinders, Thomas Shelby (Cillian Murphy) e seus irmãos retornam a Birmingham depois de servir no exército britânico durante a Primeira Guerra Mundial. Shelby e os Peaky Blinders, a gangue na qual ele é líder, controlam a cidade de Birmingham. Mas, como as ambições de Shelby se estendem para além de Birmingham, ele planeja construir o império de negócios que criou e impedir qualquer um que atrapalhar.\",\n  \"yt\": \"https://www.youtube.com/watch?v=Ruyl8_PT_y8&ab_channel=Netflix\",\n  \"imdb\": \"https://www.imdb.com/title/tt2442560/?ref_=nv_sr_srsg_0\"\n}, {\n  \"categoria\": \"Em alta\",\n  \"id\": \"friends\",\n  \"imagem\": \"./images/friendsCapa.jpg\",\n  \"descricao\": \"Seis jovens são unidos por laços familiares, românticos e, principalmente, de amizade, enquanto tentam vingar em Nova York. Rachel é a garota mimada que deixa o noivo no altar para viver com a amiga dos tempos de escola Monica, sistemática e apaixonada pela culinária. Monica é irmã de Ross, um paleontólogo que é abandonado pela esposa, que descobriu ser lésbica. Do outro lado do corredor do apartamento de Monica e Rachel, moram Joey, um ator frustrado, e Chandler, de profissão misteriosa. A turma é completa pela exótica Phoebe.\",\n  \"yt\": \"https://www.youtube.com/watch?v=Xs-HbHCcK58&ab_channel=edisonlsm\",\n  \"imdb\": \"https://www.imdb.com/title/tt0108778/?ref_=nv_sr_srsg_0\"\n}, {\n  \"categoria\": \"Em alta\",\n  \"id\": \"vida\",\n  \"imagem\": \"./images/avidaemoutrosCapa.jpg\",\n  \"descricao\": \"Aplicando as leis de vida na Terra, para o resto da galáxia, a série mistura fatos científicos e ficção científica para imaginar vidas alienígenas em outros planetas.\",\n  \"yt\": \"https://www.youtube.com/watch?v=JW3BtGVpNEM&ab_channel=Th%C3%A9oMalucoTrailers\",\n  \"imdb\": \"https://www.imdb.com/title/tt13464340/?ref_=nv_sr_srsg_0\"\n}, {\n  \"categoria\": \"Em alta\",\n  \"id\": \"aranha\",\n  \"imagem\": \"./images/homemaranhaCapa.jpg\",\n  \"descricao\": \"Em Homem-Aranha: De Volta ao Lar, depois de atuar ao lado dos Vingadores, chegou a hora de Peter Parker (Tom Holland) voltar para casa e para a sua vida, já não mais tão normal. Lutando diariamente contra pequenos crimes nas redondezas, ele pensa ter encontrado a missão de sua vida quando o terrível vilão Abutre (Michael Keaton) surge amedrontando a cidade. O problema é que a tarefa não será tão fácil como ele imaginava.\",\n  \"yt\": \"https://www.youtube.com/watch?v=2x-2iYxgMFU&ab_channel=SonyPicturesBrasil\",\n  \"imdb\": \"https://www.imdb.com/title/tt2250912/?ref_=nv_sr_srsg_6\"\n}, {\n  \"categoria\": \"Em alta\",\n  \"id\": \"batman\",\n  \"imagem\": \"./images/batmanCapa.jpg\",\n  \"descricao\": \" Após dois anos desde o surgimento do Batman (Christian Bale), os criminosos de Gotham City têm muito o que temer. Com a ajuda do tenente James Gordon (Gary Oldman) e do promotor público Harvey Dent (Aaron Eckhart), Batman luta contra o crime organizado. Acuados com o combate, os chefes do crime aceitam a proposta feita pelo Coringa (Heath Ledger) e o contratam para combater o Homem-Morcego.\",\n  \"yt\": \"https://www.youtube.com/watch?v=a-PVBsmiB0Y&ab_channel=FilmesHQ%27s\",\n  \"imdb\": \"https://www.imdb.com/title/tt0468569/?ref_=nv_sr_srsg_0\"\n}, {\n  \"categoria\": \"Em alta\",\n  \"id\": \"planeta\",\n  \"imagem\": \"./images/nossoplanetaCapa.jpg\",\n  \"descricao\": \" Uma viagem por 50 países que mostra a diversidade de habitats aoredor do mundo. São imagens inéditas da vida selvagem, desde o Ártico, passando pelas selvas da América do Sul e pelas profundezas dos oceanos, até as paisagens africanas. O projeto mostra a importância de preservar o mundo natural.\",\n  \"yt\": \"https://www.youtube.com/watch?v=IEl1u_hHKac&ab_channel=NetflixBrasil\",\n  \"imdb\": \"https://www.imdb.com/title/tt9253866/?ref_=nv_sr_srsg_3\"\n}, {\n  \"categoria\": \"Seriados\",\n  \"id\": \"breaking\",\n  \"imagem\": \"./images/breakingbadCapa.jpg\",\n  \"descricao\": \"Walter White (Bryan Cranston) é um professor de química na casa dos 50 anos que trabalha em uma escola secundária no Novo México. Para atender às necessidades de Skyler (Anna Gunn), sua esposa grávida, e Walt Junior (RJ Mitte), seu filho deficiente físico, ele tem que trabalhar duplamente. Sua vida fica ainda mais complicada quando descobre que está sofrendo de um câncer de pulmão incurável. Para aumentar rapidamente a quantidade de dinheiro que deixaria para sua família após sua morte, Walter usa seu conhecimento de química para fazer e vender metanfetamina, uma droga sintética. Ele conta com a ajuda do ex-aluno e pequeno traficante Jesse (Aaron Paul) e enfrenta vários desafios, incluindo o fato de seu concunhado ser um importante nome dentro da Agência Anti-Drogas da região.\",\n  \"yt\": \"https://www.youtube.com/watch?v=2-W6_6gJda0&ab_channel=Mr.Mercury\",\n  \"imdb\": \"https://www.imdb.com/title/tt0903747/?ref_=nv_sr_srsg_0\"\n}, {\n  \"categoria\": \"Seriados\",\n  \"id\": \"lacasa\",\n  \"imagem\": \"./images/casadepapelCapa.jpg\",\n  \"descricao\": \"Em La Casa de Papel da Netflix, nove habilidosos ladrões (Nairóbi, Berlim, Tókyo, Rio, Helsinki, Oslo, Professor, Denver e Moscou) se trancam na Casa da Moeda da Espanha com o ambicioso plano de realizar o maior roubo da história. Para isso, a gangue precisa lidar com as dezenas de pessoas que manteve como refém, além dos agentes da força de elite da polícia, que farão de tudo para que a investida dos criminosos fracasse.\",\n  \"yt\": \"https://www.youtube.com/watch?v=yKXYXgo7a3I&ab_channel=AdoroFilmes\",\n  \"imdb\": \"https://www.imdb.com/title/tt6468322/?ref_=nv_sr_srsg_0\"\n}, {\n  \"categoria\": \"Seriados\",\n  \"id\": \"dark\",\n  \"imagem\": \"./images/darkCapa.jpg\",\n  \"descricao\": \"Quatro diferentes famílias - Kahnwald, Nielsen, Doppler e Tiedemann - vivem em Winden, uma pequena e aparentemente tranquila cidade alemã. A rotina dos moradores vira de cabeça para baixo quando duas crianças desaparecem misteriosamente, nas proximidades de uma antiga usina nuclear. Segredos familiares começam a emergir à medida que a polícia investiga os sumiços e logo percebe uma relação com eventos também sombrios do passado. O tempo e o espaço parecem se embaralhar cada vez mais, deflagrando uma série de tragédias que, curiosamente, se repete a cada geração.\",\n  \"yt\": \"https://www.youtube.com/watch?v=rrwycJ08PSA&ab_channel=ONEMedia\",\n  \"imdb\": \"https://www.imdb.com/title/tt5753856/?ref_=nv_sr_srsg_3\"\n}, {\n  \"categoria\": \"Seriados\",\n  \"id\": \"walking\",\n  \"imagem\": \"./images/walkingdeadCapa.jpg\",\n  \"descricao\": \"Em The Walking Dead, um apocalipse provoca uma infestação de zumbis na cidade de Cynthiana, em Kentucky, nos Estados Unidos, e o oficial de polícia Rick Grimes (Andrew Lincoln) descobre que os mortos-vivos estão se propagando progressivamente. Ele decide unir-se aos homens e mulheres sobreviventes para que tenham mais força para combater o fenômeno que os atinge. O grupo percorre diferentes lugares em busca de soluções para o problema.\",\n  \"yt\": \"https://www.youtube.com/watch?v=R1v0uFms68U&ab_channel=MahaloVideoGames\",\n  \"imdb\": \"https://www.imdb.com/title/tt1520211/\"\n}, {\n  \"categoria\": \"Seriados\",\n  \"id\": \"rain\",\n  \"imagem\": \"./images/The_Rain.PNG\",\n  \"descricao\": \"Criada por Jannik Tai Mosholt, Christian Potalivo e Esben Toft Jacobsen, The Rain conta a história de um futuro pós apocalíptico em que a Escandinávia foi dominada por uma chuva que carrega um vírus mortal. Com isso, se instaurou a fome e os sobreviventes são forçados a viverem abrigados, temendo o mau tempo\",\n  \"yt\": \"https://www.youtube.com/watch?v=Se3AfHO7GmY&ab_channel=NetflixBrasil\",\n  \"imdb\": \"https://www.imdb.com/title/tt6656238/?ref_=nv_sr_srsg_0\"\n}, {\n  \"categoria\": \"Filmes\",\n  \"id\": \"origem\",\n  \"imagem\": \"./images/aorigemCapa.jpg\",\n  \"descricao\": \"Em um mundo onde é possível entrar na mente humana, Cobb (Leonardo DiCaprio) está entre os melhores na arte de roubar segredos valiosos do inconsciente, durante o estado de sono. Além disto ele é um fugitivo, pois está impedido de retornar aos Estados Unidos devido à morte de Mal (Marion Cotillard). Desesperado para rever seus filhos, Cobb aceita a ousada missão proposta por Saito (Ken Watanabe), um empresário japonês: entrar na mente de Richard Fischer (Cillian Murphy), o herdeiro de um império econômico, e plantar a ideia de desmembrá-lo. Para realizar este feito ele conta com a ajuda do parceiro Arthur (Joseph Gordon-Levitt), a inexperiente arquiteta de sonhos Ariadne (Ellen Page) e Eames (Tom Hardy), que consegue se disfarçar de forma precisa no mundo dos sonhos.\",\n  \"yt\": \"https://www.youtube.com/watch?v=R_VX0e0PX90&ab_channel=WarnerBros.PicturesBrasil\",\n  \"imdb\": \"https://www.imdb.com/title/tt1375666/?ref_=nv_sr_srsg_0\"\n}, {\n  \"categoria\": \"Filmes\",\n  \"id\": \"diabo\",\n  \"imagem\": \"./images/odiaboCapa.jpg\",\n  \"descricao\": \"Ambientada entre a Segunda Guerra Mundial e a Guerra do Vietnã, O Diabo de Cada Dia acompanha diversos personagens num canto esquecido de Ohio, os quais a vida acabam se conectando. Willard Russell (Bill Skarsgård) é um atormentado veterano, sobrevivente de uma carnificina, que não consegue salvar sua bela esposa de uma morte agonizante por conta de um câncer, mesmo com toda a oração e devoção de sua parte. Enquanto isso, Carl (Jason Clarke) e Sandy Henderson (Riley Keough), um casal de assassinos em série, percorrem as rodovias americanas em busca de modelos adequadas para fotografar e exterminar. E no meio disso tudo está Arvin Russell (Tom Holland), filho órfão de Willard e Charlotte (Haley Bennett), que cresceu para ser um homem bom mas começa a demonstrar comportamentos violentos quando passa a desconfiar que o líder religioso da cidade, Preston Teagardin (Robert Pattinson), é uma farsa.\",\n  \"yt\": \"https://www.youtube.com/watch?v=MUS6nMMjLSk&ab_channel=NetflixBrasil\",\n  \"imdb\": \"https://www.imdb.com/title/tt7395114/?ref_=nv_sr_srsg_0\"\n}, {\n  \"categoria\": \"Filmes\",\n  \"id\": \"it\",\n  \"imagem\": \"./images/itCapa.jpg\",\n  \"descricao\": \"Em It - A Coisa, um grupo de sete adolescentes de Derry, uma cidade no Maine, formam o auto-intitulado 'Losers Club' - o clube dos perdedores. A pacata rotina da cidade é abalada quando crianças começam a desaparecer e tudo o que pode ser encontrado delas são partes de seus corpos. Logo, os integrantes do 'Losers Club' acabam ficando face a face com o responsável pelos crimes: o palhaço Pennywise.\",\n  \"yt\": \"https://www.youtube.com/watch?v=dD264ZjfKlk&ab_channel=WarnerBros.PicturesBrasil\",\n  \"imdb\": \"https://www.imdb.com/title/tt1396484/?ref_=nv_sr_srsg_6\"\n}, {\n  \"categoria\": \"Filmes\",\n  \"id\": \"velozes\",\n  \"imagem\": \"./images/velozesCapa.jpg\",\n  \"descricao\": \"Velozes e Furiosos 7 acompanha Dom (Vin Diesel), Brian (Paul Walker), Letty (Michelle Rodriguez) e o resto da equipe após os acontecimentos em Londres. Apesar de terem suas chances de voltar para os Estados Unidos e recomeçarem suas vidas, a tranquilidade do grupo é destruída quando Deckard Shaw (Jason Statham), um assassino profissional, quer vingança pela morte de seu irmão. Agora, a equipe tem que se reunir para impedir este novo vilão. Mas dessa vez, não é só sobre ser veloz. A luta é pela sobrevivência.\",\n  \"yt\": \"https://www.youtube.com/watch?v=hujU0dw6Erk&ab_channel=UniversalPicturesBrasil\",\n  \"imdb\": \"https://www.imdb.com/title/tt2820852/?ref_=nv_sr_srsg_8\"\n}];\n\n\n//# sourceURL=webpack://scrapybook.es6/./src/sinopse.js?");

